import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { CssBaseline, ThemeProvider } from '@mui/material';

// Components
import Navbar from './components/Navbar.jsx';
import Footer from './components/Footer.jsx';

// Pages
import HomePage from './pages/HomePage.jsx';
import Staffs from './pages/Staffs/Staffs.jsx';
import StaffCreate from './pages/Staffs/StaffCreate.jsx';

import AppTheme from './styles/AppTheme.js';
console.log(AppTheme);
// import './App.css';

const App = () => {
  const defaultTheme = createTheme({
    palette: {
      primary: {
        main: "#03074f"
      },
      secondary: {
        main: '#fff'
      }
    },
    typography: {
      navbar: {
        fontSize: '5rem'
      }
    }
  })
  return (
    <ThemeProvider theme={AppTheme}>
      <Router>
        <Navbar/>
        <Routes>
          <Route exact path='/' element={<HomePage/>} />
          <Route exact path='/staffs' element={<Staffs/>} />
          <Route exact path='/staffs/create' element={<StaffCreate/>} />
        </Routes>
        <Footer/>
      </Router>
      <CssBaseline />
    </ThemeProvider>
  )
}

export default App;
